  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"March 26, 2007    Daniel Buckley  Federal
    Election Commission  Washington DC 20463    Re:\tAmended October Monthly Report
    (September 1, to September 30, 2006)    Pursuant to your letter dated, February
    23, 2007, regarding the Amended October Monthly Report, we are responding to your
    questions as follows:    Upon further review of the data previously reported and
    as a result of the changes to the April, May, June, July, August and September
    reports amended on March 26, 2007 we identified an overstatement of contributions
    in the amount of $221 and an increase in expenditures in the amount of $4.00.
    \ The net change in cash available from our Amended October Report filed on January
    8, 2007, is $98.87.    In response to your letter dated December 6, 2006, activity
    on H6 has been reclassified as Generic Campaign activity and transfers have been
    changed accordingly.    Year to Date totals are corrected on this report and reflect
    changes in lines 7, 11ai, 17, 21ai, 21aii, 21b, 21c, 31 and 32 made in amended
    reports filed on March 26, 2007 for the period between April 1, 2006 and December
    31, 2006.      Allocated activity reported on H4 year to date totals are correct
    on lines 21ai and 21aii.    As a result of software upgrade on March 5, 2007,
    we are no longer able to sort our data based on date of expenditure.   The software
    program however, reflects a date total on each record.  Consequently, each record
    shows a  year to date total for the type of activity based on date, but the random
    reporting by name of the expenditures, makes the year to date totals appear incorrect.
    \ After careful reconciliation of each activity, the totals reflected on lines
    21ai and 21aii are correct for the allocated expenditures.    Respectfully submitted,
    Wayne Tucker, Treasurer\""
